Taip prasidėjo šventė Marijampolėje. Suvalkijos sostinė dar niekada nebuvo karūnuota Lietuvos futbolo A lygos laurais. Sekmadienį tai pagaliau įvyko. „Šiandien Lietuvoje atsirado dar viena stipri komanda. Nuėjome ilgą kelią, daug ir sunkiai dirbome, neskaičiavome jėgų. Ir dabar dar turime ties kuo dirbti, daug ką reikia gerinti. Bet faktas, kad šiandien  „Sūduva“  yra stipriausia komanda čempionate“, – nusibraukęs nuo veido šampano lašus, plačiai šypsojosi V. Čeburinas. Kaip Marijampolė niekada nebuvo tapusi šalies futbolo sostine, taip 52-ejų kazachas niekad nebuvo čempionu. Didžiausi jo laimikiai gimtinėje buvo du medaliai, pelnyti su  Karagandos „Šachtior“  ir Kokšetau „Okžetpes“. Bet nė vienas jų nebuvo auksinis. 2014-aisiais V. Čeburinas atvedė Pakruojo „Kruoją“ iki didžiausio šio trumpai Lietuvos futbolo padangėje šmėkštelėjusio klubo pasiekimo – sidabro apdovanojimų. Bet ir tuomet aukščiau dar buvo „Žalgiris“. Dabar virš V. Čeburino galvos – tik dangus. „Ypatinga akimirka“, – pasitenkinimo neslėpė kazachas. Lietuvos futbolas – ne toks turtingas kaip Kazachstano, bet ir čia V. Čeburinui nebuvo paprasta rasti vietą po saule. „Sūduvai“ – vienam stabiliausių finansiškai šalies klubų – vienas nusivylimas keitė kitą, vieną trenerį – kitas strategas. Marijampoliečiai neprilygdavo ne tik „Žalgiriui“: tai  Klaipėdos „Atlantas“ , tai „Trakai“ pastaraisiais metais turnyro lentelėje įsitaisydavo aukščiau. 2016-ųjų rugsėjį „Sūduvos“ vadeles suėmęs V. Čeburinas pagaliau atnešė nuoseklumo, nors ir jam teko kantriai kentėti, kol žaidėjai mokėsi kazacho mėgstamiausio „arkliuko“ – standartinių padėčių realizavimo. Kita vertus, sekmadienį V. Čeburinas parodė lankstumą: kuomet visi laukė „Sūduvos“ barikadų savoje aikštės pusėje, marijampoliečiai, kuriems pakako lygiųjų, plačiai atlapojo vartus ir visa niokojančia jėga patys išlėkė į puolimą, lemiamų rungtynių pradžioje demoralizavusį „Žalgirį“. 7 ir 8 min. du įvarčius pelnę suvalkiečiai laimėjo 3:0 – titulą praradusiems vilniečiams tai buvo katastrofiška sezono pabaiga. „Mes irgi galvojome, kad varžovai taip galvos, – paklaustas apie netikėtą „Sūduvos“ taktiką, šypsojosi V. Čeburinas. – Todėl ir nusprendėme žaisti priešingai.“ Gulinčio priešininko treneris nebespardė: pagyrė „Žalgirį“ ir padėkojo už kovą. „Tikiu, kad jie čia atvažiavo laimėti. „Žalgiris“ irgi organizavo atakas, kūrė, bet kai pačioje pradžioje praleidi du įvarčius, ant galvos neišvengiamai gula spaudimas. Jie nebeišlaikė, ėmė nervintis, žaisti grubiau, nors nemanau, kad specialiai prasižengdavo. Taip jau būna, kai tokia situacija“, – dėl kelių aistras sukėlusių pražangų žalgiriečių nekaltino V. Čeburinas. O savo auklėtiniams treneris turėjo paprastą patarimą. „Pasakiau jiems: branginkite tokius momentus. Kai pasensite, žiūrėsite į šias fotografijas ir sakysite: štai tada aš buvau laimingas“, – įsitikinęs specialistas. Ir pats V. Čeburinas iškart po rungtynių buvo nusiteikęs mėgautis auklėtinių atnešta ir ant stalo treneriui pastatyta nugalėtojų taure, o ne rūpintis ateitimi. „Šiandien pašvęskime, o paskui jau kalbėsime apie planus“, – atsisveikino kazachas. (function(d, s, i, r) {
